import React from 'react';

const Contact = () => {
    return (
        <section id="contact">
            <h2>Contact Me</h2>
            <form>
                <label>
                    Name:<br></br>
                    <input type="text" name="name" />
                </label>
                <label>
                    Email:<br></br>
                    <input type="email" name="email" />
                </label>
                <label>
                    Message:<br></br>
                    <textarea name="message"></textarea>
                </label>
                <button type="submit">Send</button>
            </form>
        </section>
    );
};

export default Contact;
